import React from "react";
import logo from "../images/logo.png";
import left from "../images/left.png";
import mid from "../images/mid.png";
import rigth from "../images/rigth.png";
const Menu = () => {
  return (
    <>
      <div
        style={{
          width: "100%",
          display: "flex",
          gap: "40px",
          justifyContent: "flex-end",
          marginTop: "66px",
          alignItems: "center",
        }}
      >
        <p style={{ fontSize: "25px", color: "#02B589", lineHeight: "23px" }}>
          Хэрхэн ажилладаж вэ?
        </p>
        <button
          style={{
            marginRight: "123px",
            fontSize: "20px",
            borderRadius: "100px",
            width: "183px",
            height: "44px",
            backgroundColor: "#02B589",
            border: "none",
            color: "white",
          }}
        >
          Нэвтрэх
        </button>
      </div>
      <div
        style={{
          width: "100%",
          height: "100%",
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        <div style={{ display: "flex", alignItems: "center" }}>
          <img src={left} />
          <img src={mid} />
          <img src={rigth} />
        </div>
        <img src={logo} />
      </div>
      <div>
        <input
          placeholder="https://www.web-huudas.mn"
          style={{
            fontSize: "20px",
            width: "581px",
            height: "44px",
            borderRadius: "100px",
            border: "1px solid grey",
          }}
        />
        <button style={{ width: "192px" }}>Богиносгох</button>
      </div>
      <div>
        <p>Made with ♥️ by Nest Academy</p>
        <p>©boginoo.io 2020</p>
      </div>
    </>
  );
};
export default Menu;
